import React, { Component } from "react";
import "../../style.css"

class PostContainer extends Component {
  constructor() {
    super();
    this.state = {
      name: "Profile"
    };
  }

  render() {
    return <div>
                            <div className="newPost">
                    </div>
                    <div className="noteSection">
                    </div>
                    <div className="bookmarkSection">
                    </div>
    </div>;
  }
}

export default PostContainer;
